// SPDX-License-Identifier: MIT
pragma solidity ^0.8.5;

import "@openzeppelin/contracts/access/AccessControl.sol";

/**
 * @title Governance contract
 */
contract Governance is AccessControl {
    bytes32 public constant ADMIN = keccak256("ADMIN");
    uint8 public constant FEE_DECIMALS = 1;
    uint8 public constant BEATS_DECIMALS = 3;

    uint64 public maxBopChilds = 7;
    uint64 public breedTraxCost;
    uint64 public breedMinBeats = uint64(10**BEATS_DECIMALS);

    uint256 private minimumSecondsToSubscribe;
    uint256 private maximumSecondsToApplyDiscount;
    uint256 private incrementRate;
    uint256 private maxDiscount;
    address private stableCoin;
    uint256 private podVotingPeriod;

    // 10 percent for both fees (1 decimal for this values)
    uint32 public traxUnravelFee = 100;
    uint32 public stablecoinUnravelFee = 100;

    constructor(
        uint256 traxDecimals,
        uint256 _minimumSecondsToSubscribe,
        uint256 _maximumSecondsToApplyDiscount,
        uint256 _incrementRate,
        uint256 _maxDiscount,
        address _stableCoin
    ) {
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(ADMIN, msg.sender);

        breedTraxCost = uint64(10**traxDecimals);

        minimumSecondsToSubscribe = _minimumSecondsToSubscribe;
        maximumSecondsToApplyDiscount = _maximumSecondsToApplyDiscount;
        incrementRate = _incrementRate;
        maxDiscount = _maxDiscount;
        stableCoin = _stableCoin;
    }

    function getMinimumSecondsToSubscribe() external view returns (uint256) {
        return minimumSecondsToSubscribe;
    }

    function getMaximumSecondsToApplyDiscount() external view returns (uint256) {
        return maximumSecondsToApplyDiscount;
    }

    function getIncrementRate() external view returns (uint256) {
        return incrementRate;
    }

    function getMaxDiscount() external view returns (uint256) {
        return maxDiscount;
    }

    function getStableCoin() external view returns (address) {
        return stableCoin;
    }

    function getPodVotingPeriod() external view returns (uint256) {
        return podVotingPeriod;
    }

    /**
     * @param _quantity the new max number
     */
    function setMaxBopChilds(uint256 _quantity) external onlyRole(ADMIN) {
        maxBopChilds = uint64(_quantity);
    }

    function setMaximumSecondsToApplyDiscount(uint256 _maximumSecondsToApplyDiscount) external onlyRole(ADMIN) {
        maximumSecondsToApplyDiscount = _maximumSecondsToApplyDiscount;
    }

    function setIncrementRate(uint256 _incrementRate) external onlyRole(ADMIN) {
